func GetPgsqlUdf(os, platform, version string) string {
	log.Info(fmt.Sprintf("os: %s , platform: %s, version: %s", os, platform, version))
	var mVersion string

	versionSplit := strings.Split(version, ".")
	if len(versionSplit) == 1 {
		mVersion = version
	} else {
		first, _ := strconv.Atoi(versionSplit[0])
		if first >= 10 {
			mVersion = versionSplit[0]
		} else {
			mVersion = versionSplit[0] + "_" + versionSplit[1]
		}
	}

	log.Info("main version: ", mVersion)

	udfHex := PgsqlUdfMap[fmt.Sprintf("%s_%s_%s", os, platform, mVersion)]
	if udfHex == "" {
		log.Warn("no udf found for the os and platform")
	}
	return udfHex
}
